import React from "react"; 
import Navbar from 'react-bootstrap/Navbar'   
import "bootstrap/dist/css/bootstrap.min.css"




const navbar = props => {
  return (
    <div>
      <Navbar bg="dark" variant="dark">
    <Navbar.Brand >The Shoppies</Navbar.Brand>
  </Navbar>
    </div>
  )
}

export default navbar
